    result: dict[str, str] = {}
    for line in log.splitlines():
        # Typical lines:
        # test oversampling::tests::convolve_rb::test_no_wrap ... ok
        # test oversampling::tests::convolve_rb::test_with_wrap ... ok
        # test src/buffer.rs - buffer::Buffer<'a>::iter_blocks (line 90) ... ignored
        m = re.match(r"test\s+([^\s]+)\s+\.\.\.\s*(ok|FAILED|ignored)", line)
        if m:
            test, status = m.groups()
            status = status.lower()
            if status == "ok":
                result[test] = "pass"
            elif status == "failed":
                result[test] = "fail"
            elif status == "ignored":
                result[test] = "skip"
    return result

