def get_pertest_cmd(testcase_list:list[str])->dict[str,str]:
    result = {}
    # Figure out which tests belong to which package
    for testcase in testcase_list:
        # heuristically, if the test's name starts with "rayon-core", use the rayon-core package
        # some tests use slashes for their source-path (e.g. rayon-core/src/lib.rs)
        if testcase.startswith("rayon-core"):
            pkg = "rayon-core"
        elif testcase.startswith("src/") or testcase.startswith("rayon-core/"):
            # If source path points to rayon-core, use that
            pkg = "rayon-core"
        else:
            pkg = "rayon"
        result[testcase] = f"cargo test --verbose --package {pkg} -- --exact '{testcase}'"
    return result
